import React from 'react';
import SvgIcon from '@material-ui/core/SvgIcon';
import IconButton from '@material-ui/core/IconButton';

export const SwapArrow = props => {   
    return (
        <IconButton>
            <SvgIcon {...props}>
                <svg width="24" height="24" ><path d="M6.99 11L3 15l3.99 4v-3H14v-2H6.99v-3zM21 9l-3.99-4v3H10v2h7.01v3L21 9z"/></svg>
            </SvgIcon>
        </IconButton>
    );
};
